import React from 'react';
import Hero from '../components/Hero';
import work from '../assets/images/work.jpg';
import workmiddle from '../assets/images/work-middle.jpg';
import workresize from '../assets/images/workresize.jpg'
import { ResponsiveImage, ResponsiveImageSize } from 'react-responsive-image';


function ProjectPage(props){
    return(
        <div className="page-content">
            <Hero title={props.title} />
            <ResponsiveImage>
            <ResponsiveImageSize
                default
                minWidth={0}
                path={work}/>
            <ResponsiveImageSize
                minWidth={768}
                path={workmiddle}/>
            <ResponsiveImageSize
                minWidth={1100}
                path={workresize}/>
            </ResponsiveImage>
            <p><br></br>In this section i will talk about the project i have done and involved id. 
            Most of then are school projects.</p>
        </div>
    );
}

export default ProjectPage;
